import React, { Component } from "react";
import { Link } from "react-router-dom";
import Header from "../components/Header";


class LogIn extends Component {

render() {
    return (
        <React.Fragment>
            <Header />
            <h1>Hello.</h1>
        </React.Fragment>
    );
}

}

export default LogIn;
